(219, 'Balaikota Komplek', 'Jl. Kebon Sirih  Jak Pus', 'Kebon Sirih', 'Menteng', 'Pusat', '10340', '', NULL, '', NULL, '', NULL, '', NULL, '', NULL, NULL, 'Pemda DKI', 'Perkantoran ', 'Tinggi', '1', '1', 24, 0, '', NULL, '', '3', '[{\"No\":1,\"Keterangan\":\"Sistem pipa tegak dan slang kebakaran serta hidran halaman : Pada Blok A  C sistem hidran tidak terhubung dengan pompa kebakaran; Blok B, Blok D, Blok E,  Blok F Pompa terpasang tidak standar pompa kebakaran; Blok G Pompa kebakaran tidak dilengkapi dengan pompa cadangan dengan penggerak motor diesel serta Pompa utama bekerja secara manual\"},{\"No\":2,\"Keterangan\":\"Sistem springkler Otomatis : Pompa-pompa springkler yang terpasang bukan dari jenis pompa standar kebakaran; Pompa springkler tidak dilengkapi dengan pompa cadangan; Instalasi springkler dalam kondisi bocor dan untuk seluruh zone tidak dilengkapi dengan Sambungan Dinas Pemadam Kebakaran (siamesse connnection)\"},{\"No\":3,\"Keterangan\":\"Sistem deteksi alarm kebakaran : Panel kontrol alarm Blok B, A-C dan G dalam keadaan trouble; Pada  Blok D, E, F tidak tersedia panel kontrol alarm\"},{\"No\":4,\"Keterangan\":\"Alat Komunikasi Darurat : Blok A - C, B, D, E dan F belum dilengkapi dengan sistem komunikasi darurat\"},{\"No\":5,\"Keterangan\":\"Sarana Penyelamatan Jiwa  : Tangga kebakaran pada lantai 4, 7, 8 dan 11 terdapat kompressor AC; Dibagian atas tangga kebakaran terpasang exhaust fan; Pintu tangga service terbuat dari kayu\"},{\"No\":6,\"Keterangan\":\"seluruh pintu Shaf terbuat dari kayu dan setiap lantai belum di Fire Stop\"},{\"No\":7,\"Keterangan\":\"Tangga kebakaran tidak dilengkapi pencahayaan darurat\"},{\"No\":8,\"Keterangan\":\"Petunjuk Arah Darurat (exit sign) yang terpasang sebagian besar dalam keadaan tidak menyala (mati)\"},{\"No\":9,\"Keterangan\":\"Alat Pemadam Api Ringan seluruhnya sudah kadaluwarsa\"},{\"No\":10,\"Keterangan\":\"Supply listrik hanya dari sumber daya listrik utama (PLN), Kebutuhan listrik sistem proteksi kebakaran harus mendapat supplai listrik dari sumber daya cadangan (genset). \"},{\"No\":11,\"Keterangan\":\"Kabel listrik yang digunakan untuk sarana proteksi kebakaran, kabel travo belum menggunakan kabel tahan api, tahan air dan benturan\"},{\"No\":12,\"Keterangan\":\"Kipas penekan asap (pressurized fan) tidak interkoneksi dengan alarm kebakaran\"},{\"No\":13,\"Keterangan\":\"Lif Kebakaran ataupun lif-lif lainnya tidak interkoneksi dengan alarm kebakaran\"}]', NULL, NULL, NULL, 'bambang', 2, 'Balai Kota Jakarta', 'a:7:{s:15:\"gambar_scematik\";b:0;s:15:\"gambar_siteplan\";b:0;s:12:\"dokumen_mkkg\";b:0;s:6:\"fc_slf\";b:0;s:6:\"fc_imb\";b:0;s:6:\"fc_skk\";b:0;s:6:\"fc_lhp\";b:0;}', 1),
